Defendant Jonathan W Markwick in court, in custody, with attorney Amber K. Rumpf.   Kristi J Gordon appeared for the State of Wisconsin.  Defendant pleads no contest to count #3.  Court finds the defendant guilty of count #3.  Counts 1 and 2 are dismissed and read in.  State makes recommendations.  Attorney Rumpf makes statements.  Defendant makes statements. 
The Court Orders the Following:  Count #3.  

Imposed and Stayed Sentence of:
1 year Huber with STANDARD RELEASE CONDITIONS.  (Credit - 122 days).  
Term of Probation: 2 Years
Conditions of Probation:

**** Defendant to remain in Jail until Thursday 3/31/2016 @ 5:00 pm.  The Agent to assist the defendant with getting a place to live before he is released.  

Follow through with any treatment and/or counseling recommended by Agent;
No contact with Carroll College or the victims listed in the criminal complaint.
AODA Assessment and follow through with any treatment recommended;
Absolute Sobriety; Random U.A.s;
No Use or Possession of alcohol or illegal controlled substances or drug paraphernalia;
Inform agent of all prescriptions;
Disclose to any physician in writing your probation conditions. 
Psychological Evaluation and follow through with any treatment recommended;
Seek employment and work towards completeing a high school diploma;
COSTS:  $243.00 to be paid as a condition of probation
DNA Surcharge:  $200.00 waived by the court.
DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 
Court stays an order requiring the defendant register as a sex offender.  Court sets a hearing concerning sex offender registration in January 2018.  Agent to notify the Court as to its position regarding sex offender registration for the defendant. 
Court denies expunction.  
Review hearing scheduled for January 22, 2018 at 08:30 am.
